import React from 'react';

import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
const data = [{name: '01/11/2024', uv: 400, pv: 2400, amt: 2400}, {name: '31/10/2024', uv: 300, pv: 4567, amt: 2400}, {name: '30/10/2024', uv: 200, pv: 1398, amt: 2400}, {name: '29/10/2024', uv: 278, pv: 3908, amt: 2400}];

const renderLineChart = (
  <LineChart width={1000} height={400} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
    <Line type="monotone" dataKey="uv" stroke="#8884d8" />
    <CartesianGrid stroke="#ccc" />
    <XAxis dataKey="name" />
    <YAxis />
    <Tooltip />
  </LineChart>
);

export function StockGraph() {
  return (
    <div className="StockGraph">
        <h1>FTSE100</h1>
      {renderLineChart}
    </div>
  );
}
